package com.assinment.loops2;

public class NoOfsSeries1020 {
	public static void printNo() {
		int ans;
		for (int i = 1; i <=10; i++) {
			ans=i*10;
			System.out.println(ans);
		}
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		printNo();
	}

}
